import React, { Component } from 'react'

export default class Beer extends Component {
    render() {
        return (
            <div>
                <img src={this.props.beer.image_url} alt="{this.props.beer.name}" width="50"/>
                <h1>{this.props.beer.name}</h1>
                <h1>{this.props.beer.tagline}</h1>
                <h1>{this.props.beer.name}</h1>
                <h1>{this.props.beer.name}</h1>



            </div>
        )
    }
}
